import React from 'react'
import { Link } from 'react-router-dom'
import '../css/DashboardStyle'

const DashboardView = () => {
    return (
        <div className='big'>
            <button><Link to='/medicine' >Medicine</Link></button>
            <button><Link to='/symptom' >Symptom</Link></button>
        </div>
    )
}

export default DashboardView
